#include <iostream>

using namespace std;

class Solution {
public:
    string shortestPalindrome(string s) {
        if(s.size()<=1) return s;
        int lpfo=1,i=s.size();
        while(i>1){
            if(isPalindrome(s.c_str(),i)) {
                lpfo = i;
                break;
            }
            i--;
        }
        int sp = s.size()*2 -lpfo;
        string ans(sp,'a');
        for(int i=0;i<s.size()-lpfo;i++){
            int si = s.size()-1-i;
            ans[i] = s[si];
        }
        for(int i=s.size()-lpfo,si=0;i<sp;i++,si++){
            ans[i] = s[si];
        }
        return ans;
    }

    bool isPalindrome(const char* s, int l){
        int a{0}, b=l-1;
        while(b>a){
            if(s[a]!=s[b]){
                return false;
            }
            a++;
            b--;
        }
        return true;
    }
};

int main() {
    Solution s;
    //auto a=s.shortestPalindrome("");
    auto a=s.shortestPalindrome("aaaaa");
    cout<<a;
    return 0;
}